import React from 'react';
import {View, TouchableOpacity} from 'react-native';
import Icon from 'react-native-vector-icons/AntDesign';
import styles from './paginas/Telainicial/style';


export default function Routes(){ 

      return(
        <View style= {{flex:1, backgroundColor: '#FFF'}}>
            <View style={styles.viewmax}>
                <TouchableOpacity>
                    <Icon name="home"
                        size={30}
                        color='#fff'
                        style={{
                            marginRight:20, 
                            marginTop: 20,
                            marginLeft: 30, 
                            backgroundColor: '#17A558',
                            borderRadius: 20,
                            width: 50,
                            height: 40,
                            }}/>
                           </TouchableOpacity>

                <TouchableOpacity>
                    <Icon name="search1"
                        size={30}
                        color='#fff' 
                        style={{
                            marginRight:20,
                            marginTop: 20,
                            marginLeft: 30,
                            backgroundColor: '#17A558',
                            borderRadius: 20,
                            width: 60,
                            height: 40
                            }}/>
                            </TouchableOpacity>

                <TouchableOpacity>
                    <Icon name="bells"
                        size={30}
                        color='#fff' 
                        style={{
                            marginRight:20,
                            marginTop: 20,
                            marginLeft: 30,
                            backgroundColor: '#17A558',
                            borderRadius: 20, 
                            width: 60,
                            height: 40
                            }}/>
                           </TouchableOpacity>
            </View>    
        </View>
      );
}
